import styled from 'styled-components'

const Wrapper = styled.div`
    display: flex;
    width: 35%;
    margin: 0 auto;
    border: 2px solid green;


    .choice{
        text-align: center;
        margin: 0 5% 0 5%;
        border: 2px solid orange;
    }
`

export default Wrapper
